import React, { useState, useEffect } from 'react';
import { Route, Switch } from 'react-router-dom';
import Filters from './Filters'
import LaunchDisplay from './LaunchDisplay'
import fetchRequests from '../../fetchRequests'

const App = (props) => {
  const [launchSuccess, setLaunchSuccess] = useState(null)
  const [landSuccess, setLandSuccess] = useState(null)
  const [year, setYear] = useState(null)
  const [updatedLaunches, setUpdatedLaunches] = useState(null)

  useEffect(() => {
    if (launchSuccess !== null || landSuccess !== null || year !== null)
      fetchRequests(!launchSuccess ? null : launchSuccess, !landSuccess ? null : landSuccess, year).then(r => { setUpdatedLaunches(r.launchData) });
  }, [launchSuccess, landSuccess, year])

  const dat = updatedLaunches ? updatedLaunches : props.launchData

  return (
    <>
      <div className="df">
        <Switch>
          <Route exact path="/" render={(props) => <><Filters year={year} p={props} setLaunchSuccess={setLaunchSuccess} setLandSuccess={setLandSuccess} setYear={setYear} />
              <LaunchDisplay launchData={dat} /></>}
          />
          <Route path="/:id" render={(props) => <><Filters year={year} p={props} setLaunchSuccess={setLaunchSuccess} setLandSuccess={setLandSuccess} setYear={setYear} />
              <LaunchDisplay launchData={dat} /></>}
          />
        </Switch>
      </div>
      <div className="name">
        <div className="dev">Developed by: </div>
        <div className="devN"> Aanchal Fatwani</div>
      </div>
    </>
  )
}

export default App

